import { ValuesType } from "types/types";
import st from "./Check.module.scss";

interface Props {
  values: ValuesType;
}

export const Check = ({ values }: Props) => {
  console.log(values);

  return (
    <div className={st.check_container}>
      <div>
        <div>Lastname</div>
        <div className={st.value}>
          {values.lastname ? values.lastname : "-"}
        </div>
      </div>
      <div>
        <div>Firstname</div>
        <div className={st.value}>{values.firstname}</div>
      </div>
      <div>
        <div>Birth</div>
        <div className={st.value}>
          {values.birth.month}-{values.birth.date}-{values.birth.year}
        </div>
      </div>
      <div>
        <div>Gender</div>
        <div className={st.value}>{filterGender(values.gender)}</div>
      </div>
      <div>
        <div>Email</div>
        <div className={st.value}>{values.email}</div>
      </div>
      <div>
        <div>Id</div>
        <div className={st.value}>{values.id.id}</div>
      </div>
      <div>
        <div>Pw</div>
        <div className={st.value}>{values.id.pw}</div>
      </div>

      <button>Submit</button>
    </div>
  );
};

export default Check;

function filterGender(gender: string) {
  switch (gender) {
    case "m":
      return "Male";
    case "f":
      return "Female";
    case "r":
      return "Rather Not Say";
  }
}
